long_desc.thetext:
As my poor knowledge about the qooxdoo internals doesn't allow real fixing I'm only able to provide a dirty fix by hiding the button's icon:

class qx/ui/table/Table.js:
_applyColumnVisibilityButtonVisible : function(value,old) {
  var columnButton = this.getChildControl("column-button");
  columnButton.setEnabled(value);
}

Appearance.js:
"table/column-button" :
{
  alias : "button-frame",
  style : function(states)
  {
    return {
      decorator : "table-column-button",
      padding   : (states.disabled?8:3),
      icon      : (states.disabled?undefined:"decoration/table/select-column-order.png")
    };
  }
}

Maybe this helps someone else - for my case it's enough for the moment.
